import React from "react";
import DicePanel from "./DicePanel";
import PlayerPanel from "./PlayerPanel";
import StatusView from "./StatusView";

const InfoPanel = () => {
  return (
    <div className="info-panel">
      <div>
        <PlayerPanel />
        <DicePanel />
      </div>
      <StatusView />
    </div>
  );
};

export default InfoPanel;
